import { Routes, Route } from "react-router";

import './App.css';

import Principal from "./page/Principal.js";

function App() {
  return (
    <div className="App">
      <div className=""></div>
      <Routes>
        <Route exact path='/' element={<Principal/>} />
      </Routes>
    </div>
  );
}

export default App;
